const Laptop = ({brand, os}) =>{
    return(<>
     <p>내 노트북은 {brand} 노트북 입니다.</p>
     <p>내 OS는 {os}입니다.</p>
    </>
    );
};

Laptop.defaultProps = {
    brand: "LG",
    os: "Linux"
}

export default Laptop;
